import './App.css';
import Footer from './components/footer/Footer';
import NavBar from './components/navbar/NavBar';
import Home from './page/home/Home';

function App() {
  return (
    <div className="App">
      <NavBar />
      <Home />
      <Footer />
    </div>
  );
}

export default App;
